import CostItem from "./components/CostItem";

function App() {

    const costs = [
      {
        date: new Date(2021, 2, 12),
        description: "Refrigerator",
        amount: 999.99,
      },
      {
        date: new Date(2021, 11, 25),
        description: "MacBook",
        amount: 9.99,
      },
      {
        date: new Date(2021, 6, 21),
        description: "Clothes",
        amount: 150.99,
      },
    ];

  return (
    <div >
      <h1>Lets start React!</h1>
      <CostItem />
    </div>
  );
}

export default App;
